import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';
import {Icon} from 'semantic-ui-react'

class MapInsert extends Component {

    static defaultProps = {
        center: {
            lat: 59.95,
            lng: 30.33
        },
        zoom: 11
    };

    render() {
        return (
        // Important! Always set the container height explicitly
            <div style={{ height: '50vh', width: '40%', margin: '30px' }}>
                <GoogleMapReact
                    bootstrapURLKeys={{ key: 'AIzaSyBV9FHRwNrE8cztf1Omrf7_UOzajYXRQyA' }}
                    defaultCenter={this.props.start_lat}
                    defaultZoom={this.props.start_lon}
                >
                    <Icon name='map pin' 
                        lat={this.props.start_lat}
                        lng={this.props.start_lon}
                        text="My Marker"
                    />
                    {/* <AnyReactComponent
                    /> */}
                </GoogleMapReact>
            </div>
        );
    }
}

  export default MapInsert
